import './App.css';
import Second from './components/Second';
// import Navbar from './components/navbar';
import Header from './components/Header';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
function App() {
  return (
    <Router>
    <div className="App">
      <Switch>
        <Route path="/">
          <Header/>
        </Route>
        <Route path="/second">
            <Second/>
        </Route>

      </Switch>

    </div>
    </Router>
  );
}

export default App;
